      <div className="product__info">
        <p>The lean startup</p>
        <p className="product__price">
          <small>$</small>
          <strong>20.99</strong>
        </p>
        <div className="product__rating">
          <p>⭐️ </p>
          <p>⭐️ </p>
          <p>⭐️ </p>
        </div>
      </div>

      <img
        src="https://images-na.ssl-images-amazon.com/images/I/51Zymoq7YnL._AC_SY400_jpg"
        alt=""
      />
    </div>
  );
}

export default Product;
